class TeamModel{
    playerId:number;
    countryId:number;
    firstName:string;
    lastName:string;
    numberShirt:number;
    role:string;
    goals:number;
    assists:number;
    imageName:string;
    image: File;
    scored:boolean;
    price:number;
    age:number;
}
export default TeamModel;
